import React from 'react';
import BudgetCard from './BudgetCard';

const BudgetList = ({data}) => {
	// 	const listMap = data.map(transaction => {
	// 		return <BudgetList 
	// 							amount={transaction.amount}
	// 							description={transaction.description}
	// 							type={transaction.type}
	// 				 		/>
	// })
	return (
		<div>
			<h2>{data[0].amount ? 'Transactions' : ''}</h2>
			{data && data.map((transaction, index) => {
				return <div><BudgetCard key={index} amount={transaction.amount} description={transaction.description} type={transaction.type} /></div>
				}
			)}
		</div>
	);
}

export default BudgetList;
